import React,{useEffect,useState} from 'react';
import { Box,colors } from '@mui/material';
import {Table,TableContainer,TableHead,TableRow} from '@mui/material';
export default  function Course(props){
    return (
        <div>
            <table>

                <tr rowspan= {2}>
                    <td colSpan={2}>
                    </td>
                </tr>


                <h3>{props.courseText}</h3>
            </table>
            
        </div>
    )
}
